import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="h-screen flex items-center w-screen bg">
      <div className="p-4 rounded-lg">
        {/* Your fading image container */}
        <div className="bg">
          <div className="image-container">
            <img src="/public/images/logo_0.png" alt="Image 1" className="image1" />
            <img src="/public/images/logo_1.png" alt="Image 2" className="image2" />
            <img src="/public/images/logo_2.png" alt="Image 3" className="image3" />
            <img src="/public/images/image4.jpg" alt="Image 4" className="image4" />
          </div>
        </div>

        <h1 className="text-6xl text-gray-300">Welcome to Our Website</h1>
        <p className="text-gray-200">La première clinique spécialisée dans La prise en charge du Diabète pluridisciplinaire en Mauritanie</p>
        <Link className="bg-blue-500 text-white p-2" to="/Contact">
          Contact Us
        </Link>
      </div>
    </div>
  );
}

export default Home;
